            id: 3,
            title: 'The Truth About Design In 3 Minutes',
            category: 'Thoughts',
            feature_image: require('../../images/blog/blog.jpg'),
            author: 'Salomi Afolabi',
            slug: 'the-truth-about-design'
        }
    ]
  return (
    <div className='blogs'>
      <Blog/>
    </div>
  )
}

export default Blogs;
